import React from "react";
import { Text, View, StyleSheet } from "react-native";

const BoxScreen = () => {
  return (
    <View style={styles.viewStyle}>
      <Text style={styles.textStyle}>Box</Text>
    </View>
  );
};

const styles = StyleSheet.create({
    viewStyle: {
        borderWidth: 3,
        borderColor: "black"
    },
    textStyle: {
        borderWidth: 1,
        borderColor: "red",
        marginVertical: 20
    }
});

export default BoxScreen;
